import { useSelector } from "react-redux"


function GameDetail () {
    const gameDetail = useSelector(initialState => initialState.gameDetail)


    return(
        <div>
            <p>{gameDetail.name}</p>
            <img src={gameDetail.image}/>
            <p>{gameDetail.rating}</p>
        </div>
    )
}


export default GameDetail
